def palindromic_substrings(str)
  str_arr = str.split('')
  count = 0
  str_len = str_arr.length

  if str_arr.uniq.length == 1
    return (str_len * (str_len+1))/2
  end

  str_arr.each_with_index do |s, index|
    count += 1
    l = index-1
    r = index+1

    count += 1 if ((index-1) >= 0) && (str_arr[l] == s) 

    temp_l = nil
    while l >=0 && r <= (str_len-1)
      if ((str_arr[l] == str_arr[r]) && temp_l == nil) || (temp_l && temp_l == str_arr[l] && (str_arr[l] == str_arr[r]))
        temp_l = str_arr[l]
        count += 1
        l -= 1
        r += 1
      else
        break
      end
    end

  end

  count
end

str = ""
p palindromic_substrings(str)